import React from 'react'

const Register = () => {
  return (    
    <header className='py-6 mb-12 border-b'>
      <div className="container mx-auto flex justify-between items-center">

        {/* logo */}
        <Link to='/'>
          <img src={intLOGO} alt="" />
        </Link>
        {/* Buttons */}
        <div className="flex items-center gap-6">
            <Link className='font-[600] text-greenColor hover:text-softColor text- transition' to='/'>Login</Link>
            <Link className='font-[600] text-white bg-greenColor py-1 px-3 border rounded-lg border-solid border-greenColor hover:text-white hover:border-white transition' to='/Register'>Register</Link>
        </div>
      </div>
    </header>
  )
}

export default Register
